INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (3001, "ヤマト", 3001100, 2, 0.0, 2.1, "2030/01/01 14:59:59", 100, 1, -416.5, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", "2024/10/31 12:00:00", 130011);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (3001, "ヤマト", 3001101, 2, 0.0, 5.68, "2030/01/01 14:59:59", 101, 4, -416.5, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", "2024/10/31 12:00:00", 130011);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (3001, "ヤマト", 3001102, 1, 0.0, 0.0, "2030/01/01 14:59:59", 102, 1, -416.5, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", "2024/10/31 12:00:00", 130011);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (3002, "フブキ", 3002100, 1, 0.0, 0.0, "2030/01/01 14:59:59", 100, 1, -416.5, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", "2024/10/31 12:00:00", 130211);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (3002, "フブキ", 3002101, 1, 0.0, 0.0, "2030/01/01 14:59:59", 101, 1, -416.5, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", "2024/10/31 12:00:00", 130211);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (3002, "フブキ", 3002102, 2, 0.0, 8.53, "2030/01/01 14:59:59", 102, 5, -416.5, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", "2024/10/31 12:00:00", 130211);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (3002, "フブキ", 3002103, 1, 0.0, 5.67, "2030/01/01 14:59:59", 103, 7, -416.5, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", "2024/10/31 12:00:00", 130211);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (3002, "フブキ", 3002104, 1, 0.0, 0.0, "2030/01/01 14:59:59", 104, 1, -416.5, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", "2024/10/31 12:00:00", 130211);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (3004, "フブキ", 3002300, 3, 0.0, 0.0, "2030/01/01 14:59:59", 300, 3, -416.5, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", "2024/10/31 12:00:00", 130211);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (3005, "フブキ", 3002400, 7, 0.0, 0.0, "2030/01/01 14:59:59", 301, 7, -416.5, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", "2024/10/31 12:00:00", 130211);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (3003, "フブキ", 3003200, 1, 0.0, 4.4, "2030/01/01 14:59:59", 200, 2, -416.5, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", "2024/10/31 12:00:00", 130211);
INSERT INTO `v1_2a53f33cf66da8769f1f1fdc91acc2e23cd812087fe6030476e85051ec3c837c` VALUES (3003, "フブキ", 3003201, 7, 0.0, 0.0, "2030/01/01 14:59:59", 201, 7, -416.5, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", "2024/10/31 12:00:00", 130211);
